import React, {Component} from "react"
import styled from 'styled-components'
import Group from './Group.png';




class Home extends Component {
  render(){
  return (


   <div>
     <br/>
    <PictureContainer className ="kimberly-pic">
      <img className ="group" src={Group} class="kimberly-pic"/>

    </PictureContainer>



    <Text>
    Hello my name is Kimberly, nice to meet you :)
    </Text>





    </div>
  );
  }
}

export default Home;


const PictureContainer = styled.picture`
.kimberly-pic{
  padding-top: 3rem;
  padding-bottom: 3rem;
  padding-right: 2px;
  margin-left: 5%;
  margin-right: auto;
  width: 50%;

}
`
const Text = styled.text`
  allign: inline;
  color: #4F4F4F;
  font-size: 30px;
`
